            env.fromCollection(Collections.emptyList(), TypeInformation.of(String.class));

    MapStateDescriptor<String, Integer> stateDescriptor =
            new MapStateDescriptor<>(
                    "BroadcastState",
                    BasicTypeInfo.STRING_TYPE_INFO,
