        }

        CompletableFuture<ExecutionGraphInfo> executionGraphFuture2 =
                executionGraphCache.getExecutionGraphInfo(expectedJobId, restfulGateway);

        assertEquals(expectedExecutionGraphInfo, executionGraphFuture2.get());
    }
}

