        this.serializer.position = 0;

        try {

            for (int i = 0; i < minFields; i++) {
                final int thisOff = this.offsets[i];
                if (thisOff == NULL_INDICATOR_OFFSET) {
                    final int otherOff = other.offsets[i];
                    if (otherOff == NULL_INDICATOR_OFFSET) {
