    }

    try {
        shuffleEnvironment.close();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        kvStateService.shutdown();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        taskSlotTable.close();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        jobLeaderService.stop();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        ioExecutor.shutdown();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        jobTable.close();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        libraryCacheManager.shutdown();
    } catch (Exception e) {
