  if (buffer.isDecodeOnly()) {
    setFlags(C.BUFFER_FLAG_DECODE_ONLY);
  }
  @Nullable ByteBuffer bufferData = buffer.data;
  if (bufferData != null) {
    ensureSpaceForWrite(bufferData.remaining());
    data.put(bufferData);
  }
  lastSampleTimeUs = buffer.timeUs;
  return true;
}

