private boolean maybeProcessDecoderOutput() throws TransformationException {
  @Nullable MediaCodec.BufferInfo decoderOutputBufferInfo = decoder.getOutputBufferInfo();
  if (decoderOutputBufferInfo == null) {
    return false;
