  if (maxPendingFrameCount != Codec.UNLIMITED_PENDING_FRAME_COUNT
      && frameProcessorChain.getPendingFrameCount() == maxPendingFrameCount) {
    return false;
  }

  frameProcessorChain.registerInputFrame();
  decoder.releaseOutputBuffer( true);
  return true;
}

