	}
	if (isAddPrefixIfAlreadyExisting() || !attribute.startsWith(getAttributePrefix())) {
		return new SimpleGrantedAuthority(getAttributePrefix() + attribute);
	}
	else {
		return new SimpleGrantedAuthority(attribute);
	}
}

